import React from "react";
import "./App.css";


function AthleteList ({ athletes, setSelectedAthlete }) {

    function handleClick(e) {
        setSelectedAthlete(e.target.id)
    }

    return (
        <div id="athlete_list">
            <p>Athlete Name(id#)</p>
            {athletes.map((athlete) => <p className="athlete_name" key={athlete.id} id={athlete.id} onClick={handleClick}>{athlete.name}({athlete.id}), {athlete.age}</p>)}
        </div>
    )
}

export default AthleteList
